import React from "react";
import { Link } from "@nextui-org/react";
import styled from 'styled-components';
import { Navbar, NavbarBrand, NavbarContent, NavbarItem, Button } from "@nextui-org/react";

const Header = () => {
  return (
    <NavbarContainer>
      <Logo>MyApp</Logo>
      <Link href="">
        Home
      </Link>
    </NavbarContainer>
  )
}

export default Header;
